import React, { Component } from 'react'
import { render } from 'react-dom'
import styles from './Cell.module.css'

class Cell extends Component {

    state = {
        display: ''
    }

    onClick = () => {
        this.setState({display : this.state.props.show})
    }

    render(){
        return(
            <div className = {styles.Cell}>{this.state.display}</div>
        )
    }
}

export default Cell
